import React from "react";
import Header from "./Header";
import Home from "./Home";
import Footer from "./Footer";
import "./App.css";
import Board from "./Board";
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">

        <Switch>
          <Route exact path="/">
            <Header />
            <Home />
            <Footer />
          </Route>

          <Route path="/board">
            <Header />
            <Board />
            <Footer />
          </Route>

        </Switch>
      </div>
    </Router>
  );
}

export default App;
